import React, { useState } from "react";

const ContainerEntryForm = () => {
  const [formData, setFormData] = useState({
    consignee: "",
    poNo: "",
    supplier: "",
    material: "",
    arrivalDate: "",
    arrivalTime: "",
    docs: "",
    tax: "",
    type: "",
    containerNo: "",
    inBound: "",
    emptyDate: "",
    outBound: "",
    unloadedAtDock: "",
    emptyAt: "",
    note: "",
  });

  const [images, setImages] = useState([]);

  const handleChange = (e) => {
    setFormData({ ...formData, [e.target.name]: e.target.value });
  };

  const handleImageChange = (e) => {
    const files = Array.from(e.target.files);
    const previews = files.map((file) => ({
      file,
      preview: URL.createObjectURL(file),
    }));
    setImages(previews);
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    console.log("Form Data:", formData);
    console.log("Uploaded Images:", images);
    // Submit to backend logic here
  };

  return (
    <div className="max-w-screen-xl mx-auto p-4 bg-white rounded shadow">
      <h2 className="text-lg font-semibold mb-4">Container Entry Form</h2>
      <form onSubmit={handleSubmit} className="grid grid-cols-1 md:grid-cols-3 gap-4">
        {/* Column 1 */}
        <div className="flex flex-col">
          <label>Consignee</label>
          <input name="consignee" onChange={handleChange} className="input" />
        </div>

        <div className="flex flex-col">
          <label>PO No</label>
          <input name="poNo" onChange={handleChange} className="input" />
        </div>

        <div className="flex flex-col">
          <label>Supplier</label>
          <input name="supplier" onChange={handleChange} className="input" />
        </div>

        {/* Material textarea */}
        <div className="col-span-1 md:col-span-3 flex flex-col">
          <label>Material</label>
          <textarea name="material" onChange={handleChange} className="input h-24" />
        </div>

        {/* Arrival Date and Time */}
        <div className="flex flex-col">
          <label>Arrival Date</label>
          <input type="date" name="arrivalDate" onChange={handleChange} className="input" />
        </div>

        <div className="flex flex-col">
          <label>Arrival Time</label>
          <input type="time" name="arrivalTime" onChange={handleChange} className="input" />
        </div>

        <div className="flex flex-col">
          <label>Docs</label>
          <input name="docs" onChange={handleChange} className="input" />
        </div>

        <div className="flex flex-col">
          <label>Tax</label>
          <input name="tax" onChange={handleChange} className="input" />
        </div>

        <div className="flex flex-col">
          <label>Type</label>
          <input name="type" onChange={handleChange} className="input" />
        </div>

        <div className="flex flex-col">
          <label>Container No</label>
          <input name="containerNo" onChange={handleChange} className="input" />
        </div>

        <div className="flex flex-col">
          <label>In Bound</label>
          <input name="inBound" onChange={handleChange} className="input" />
        </div>

        <div className="flex flex-col">
          <label>Empty Date</label>
          <input type="date" name="emptyDate" onChange={handleChange} className="input" />
        </div>

        <div className="flex flex-col">
          <label>Out Bound</label>
          <input name="outBound" onChange={handleChange} className="input" />
        </div>

        <div className="flex flex-col">
          <label>Unloaded @ Dock</label>
          <input name="unloadedAtDock" onChange={handleChange} className="input" />
        </div>

        <div className="flex flex-col">
          <label>Empty At</label>
          <input name="emptyAt" onChange={handleChange} className="input" />
        </div>

        {/* Note field */}
        <div className="col-span-1 md:col-span-3 flex flex-col">
          <label>Personal Note</label>
          <textarea name="note" onChange={handleChange} className="input h-16" />
        </div>

        {/* Image Upload */}
        <div className="col-span-1 md:col-span-3 flex flex-col">
          <label>Upload Images</label>
          <input
            type="file"
            accept="image/*"
            multiple
            onChange={handleImageChange}
            className="input"
          />

          {/* Preview Thumbnails */}
          {images.length > 0 && (
            <div className="mt-2 grid grid-cols-4 gap-2">
              {images.map((img, index) => (
                <a
                  key={index}
                  href={img.preview}
                  target="_blank"
                  rel="noopener noreferrer"
                  className="block border rounded overflow-hidden"
                >
                  <img
                    src={img.preview}
                    alt={`preview-${index}`}
                    className="w-full h-24 object-cover hover:scale-105 transition-transform duration-200"
                  />
                </a>
              ))}
            </div>
          )}
        </div>

        {/* Submit Button */}
        <div className="col-span-1 md:col-span-3">
          <button type="submit" className="bg-blue-600 text-white px-4 py-2 rounded hover:bg-blue-700 w-full">
            Submit
          </button>
        </div>
      </form>
    </div>
  );
};

export default ContainerEntryForm;
